The heavily revised and expanded 2nd edition of Johnston Karate's in-house student manual has been officially published for Kindle! There are many new articles, including our karate syllabus, as well as the outline of Mizuumi ryu Karate, the style created and taught by Johnston Karate. The 2nd edition also includes most of the material from our supplementary guides. This material includes articles on fitness, kettlebells, boxing, sparring tips, and more. To get a short preview of the book for free, and to purchase it if you like what you see, head on over to the Amazon detail page below. The book is only $2.99 and can be delivered directly to your Kindle or other device.
